//Import the library into your project
var easyinvoice = require('easyinvoice');
var sendEmail = require('./utils/sendEmail')
let ts = Date.now();


const createInvoice = (user, body, order_id) => {
    let date_ob = new Date(ts);
    let date = date_ob.getDate();
    let month = date_ob.getMonth() + 1;
    let year = date_ob.getFullYear();

    let products = [];
    body.orderItems.forEach((product) => {
        let temp = {
            "quantity": product.quantity,
            "description": product.name,
            "tax-rate": 18,
            "price": parseInt(product.price)
        }
        products.push(temp);
    })
    var data = {
        //"documentTitle": "RECEIPT", //Defaults to INVOICE
        "settings": {
            "currency": "INR",
            "tax-notation": "gst",
            "margin-top": 25,
            "margin-right": 25,
            "margin-left": 25,
            "margin-bottom": 25
        },
        "images": {
            "logo": "",
            "logo-extension": "png", //only when logo is base64
            "background": "https://public.easyinvoice.cloud/img/watermark-draft.jpg"
          },
         //or base64
        //"logoExtension": "png", //only when logo is base64
        "sender": {
            "company": "Kartify",
            "address": "TSEC, Bandra",
            "zip": "400050",
            "city": "Mumbai",
            "country": "India"
        },
        "client": {
            "company": user.name,
            "address": body.shippingInfo.address,
            "zip": body.shippingInfo.pinCode,
            "city": body.shippingInfo.city,
            "country": "India"
        },
        "information": {
            "number": order_id,
            "date": year + "." + month + "." + date,
            "due-date": "With in 48 hours"
        },
        "products": products,
        "bottom-notice": "Thank you for visiting us :)",
    };

    easyinvoice.createInvoice(data, async (result) => {
        try {
            await sendEmail({
                email: user.email,
                subject: `Kartify`,
                message: "Invoice ID : " + order_id,
                attachments: [
                    {
                        filename: 'myfile.pdf',
                        content: result.pdf,
                        encoding: 'base64',
                    },
                ],
            });
        } catch (error) {
            console.log(error)
        }
    });
}

module.exports = createInvoice;